_PACKAGES = set(["games"])

class _EmbedFinder(importlib.abc.MetaPathFinder, importlib.abc.Loader):
    def find_spec(self, fullname, path=None, target=None):
        if fullname in _EMBED:
            is_pkg = fullname in _PACKAGES
            return importlib.util.spec_from_loader(fullname, self, is_package=is_pkg)
        return None

    def create_module(self, spec):
        return None  # default module creation

    def exec_module(self, module):
        name = module.__name__
        data_b64 = _EMBED.get(name)
        if data_b64 is None:
            raise ImportError(name)
        src = zlib.decompress(base64.b64decode(data_b64)).decode("utf-8")
        module.__file__ = f"<embedded:{name}>"
        if name in _PACKAGES:
            module.__package__ = name
            module.__path__ = []  # mark as package
        else:
            module.__package__ = name.rpartition(".")[0]
        exec(compile(src, module.__file__, "exec"), module.__dict__)

def _install_importer():
    for f in sys.meta_path:
        if isinstance(f, _EmbedFinder):
            return
    sys.meta_path.insert(0, _EmbedFinder())

def _bootstrap():
    os.environ.setdefault("PYTHONIOENCODING", "utf-8")
    os.environ.setdefault("TERM", "xterm-256color")
    _install_importer()

    # Ensure storage directory exists and use it as a stable working directory.
    try:
        import games.common as _common
        storage = _common.ensure_storage()
        try:
            os.chdir(storage)
        except Exception:
            pass
    except Exception:
        pass

def _internal_selftest() -> int:
    _bootstrap()
    print("Terminal Arcade internal self-test\n")

    # 1) Syntax check: compile every embedded module source.
    for modname, b64 in _EMBED.items():
        try:
            src = zlib.decompress(base64.b64decode(b64)).decode("utf-8")
            compile(src, f"<embedded:{modname}>", "exec")
        except Exception as e:
            print(f" Compile failed: {modname}: {type(e).__name__}: {e}")
            return 1
    print(f" Syntax OK ({len(_EMBED)} modules)")

    # 2) Import launcher and validate game entrypoints.
    try:
        import launcher
    except Exception as e:
        print(f" Import failed: launcher: {type(e).__name__}: {e}")
        return 1

    if not hasattr(launcher, "GAMES"):
        print(" launcher.GAMES missing")
        return 1

    failures = 0
    for item in getattr(launcher, "GAMES", []):
        try:
            title, modname, entry, _cat = item
            mod = importlib.import_module(modname)
            fn = getattr(mod, entry)
            if not callable(fn):
                raise TypeError("entry is not callable")
            sig = inspect.signature(fn)
            if len(sig.parameters) != 1:
                raise TypeError(f"expected main(difficulty), got {sig}")
        except Exception as e:
            failures += 1
            print(f" {item[0]} -> {item[1]}.{item[2]}: {type(e).__name__}: {e}")

    if failures:
        print(f"\nSelf-test completed with {failures} failure(s).")
        return 1

    print(f" Game entrypoints OK ({len(getattr(launcher,'GAMES',[]))} games)")

    # 3) Quick logic sanity checks (non-interactive).
    try:
        from games import puzzle15, connect4, tictactoe, reversi
        # 15-Puzzle: solved state must be solvable (4x4 parity rule)
        flat = list(range(1, 16)) + [0]
        assert puzzle15.solvable(flat, 4) is True
        assert puzzle15.manhattan(flat, 4) == 0

        # Connect Four: simple vertical win
        b = connect4.make_board()
        for _ in range(4):
            connect4.drop(b, 0, "X")
        assert connect4.win(b, "X") is True

        # Tic-Tac-Toe: row win
        tb = list("XXX......")
        assert tictactoe.winner(tb) == "X"

        # Reversi: initial position has 4 legal moves for X
        rb = reversi.init_board()
        assert len(reversi.moves(rb, "X")) == 4
    except Exception as e:
        print(f" Logic check failed: {type(e).__name__}: {e}")
        return 1
    print(" Logic sanity checks OK")
    print("\nAll checks passed.")
    return 0

def main():
    _bootstrap()
    if "--selftest" in sys.argv:
        raise SystemExit(_internal_selftest())
    import launcher
    launcher.menu()

if __name__ == "__main__":
    main()
